const RatingWidget = () => {
  const NUM_STARS = 5;
  const STAR_ICON = '★';

  return (
    <section className='rating-widget'>
      {
        Array.from({ length: NUM_STARS })
          .map((_, i) =>
            <button className='star-button' key={ i }>
              { STAR_ICON }
            </button>
          )
      }
    </section>
  );
};

export default RatingWidget;
